window.bookSummaryJSON = "<p><b>Broccoli and her closest friends have discovered a terrible plot...one that might spark a war between the Nesting Kingdom and the Kingdom of Sylphfree. </b></p> <p>It’s up to the three of them to cross an entire continent in order to reach Sylphfree and undo the machinations of Broccoli’s mysterious nemesis. Navigating such a grand distance won’t be easy, however, not with dastardly sky pirates, dangerous dungeons, and adorable new friends to distract the bunch along the way! At this rate, Broccoli’s inability to get anywhere without sticking her neck into trouble is going to make Amaryllis shed feathers.</p>"; 
